import React from 'react';

const Films = props => (

    <div>
        {props.films.map((film) => {
            return (
                <div key={film.imdbID}>
                    <img src={film.Poster} alt={film.Title}></img>
                    <p >{film.Title}</p>
                </div>
            );
        })}
    </div>
);

export default Films;
